INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (4281, 518, 381, '2017-03-21 00:00:00', '09:33', 'Nossa isso para vc eh falta de respeito?   Nossa vc nao deve saber o q eh falta de respeito.   Pq nao pensou duas vezes e atacou geral.\r\n\r\nFaz o seguinte ja q tu eh o sabichao.  Tem um outro jogo que o rapaz nao jogou nem conseguiu avisar q n podia pq teve q ir as pressas ao hospital.\r\n\r\nTu acha q eh muito facil moderar, fala de um jeito q se faz de coitadinho....\r\nTemos q acreditar sim na palavra ate q se probe ao contrario.\r\nSe o adversario nao pode te avisar por algum motivo.\r\n\r\nTEM CASOS E CASOS.  SE NAO GOSTOI DO DECRETO PEDE REVISAO.  Isso eh democracia.\r\nAgora acusar isso  isso foi de uma tremenda indelicadeza e falta de respeito.\r\n\r\nNao gostou do decreto reclama num nivel acima, agora nao gostou nao vem baixar o nivel nao.   Falar para vc parar de mimimi ( eh para de reclamar e vem para o jogo)  isso eh ofensa onde?   Tu teve uma atitude bem infantil.  E contina achando q o rei da razao.  Murilo mesmo q vc tivesse um pouco de razão perdeu completamente com  sua resposta.', 'airesdias');
INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (4282, 993, 1100, '2017-03-21 00:00:00', '09:39', 'Bom dia Matheus, posso hoje das 19 às 21:30, amanhã das 18 às 19hs e quinta das 18 às 22hs. Quando pode?\r\n', 'IBRA_BIMONTI');
INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (4283, 768, 916, '2017-03-21 00:00:00', '09:39', 'Não recebi o email dessa partida \r\nE.com o adiamento do jogo com o Milan acabei não a atentando com esse. \r\nDesculpa Sérgio \r\nQueria ter jogado essa partida', 'bodaski');
