INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (4956, 978, 390, '2017-03-25 00:00:00', '14:55', 'Parcerio vamos lá vc está desesperado \r\nProblema seu se vc não jogo seus jogos\r\nVc quer a vitória vai para de me encher \r\nPode ficar ...\r\nTenho q fica respondendo direto a mesma coisa \r\nDando explicação. ..\r\nNão sei qual parte vc não entendeu. ..\r\n\r\nVê se não próxima vc realiza suas partidas não ganha ponto só por incompatibilidade de horário \r\n\r\nFds eu estou com a minha família tenho um filha que pequena quantidade mal vejo devido meus horários e essa PORRA de curso que estou fazendo então prioridade é minha família depois diversão. .ok\r\n\r\nAbs espero que tenha entendido e realize todos seus jogos. .\r\n\r\nAcabeI de acordar ', 'Bezerra2011');
