INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (4959, 978, 980, '2017-03-25 00:00:00', '15:01', 'Por gente como você que o campeonato nao anda.... veja todos meus jogos, até jogo adiantado eu tenho, entao nao venha com desculpinha furada...\r\nFamilia todo mundo aqui tem!!!!!!!!!!!!\r\nTrabalho todo mundo aqui tem!!!!!!!!\r\nMas se tu estas em um campeonato é porque tu tens que ter tempo livre pra jogar...\r\n20 minutos do teu PRECIOSO tempo não iria fazer falta.\r\nISSO É PAPO FURADO!!!\r\nNão quer jogar é mais fácil falar que nao quer jogar!!\r\nJa que acordou entao joga agora!!!\r\nQual problema?\r\nJogo dura 15/20 min....\r\nTe manca e para de mimimi, pode ter certeza que minha incompatibilidade com os outros adversários só ME PREJUDICOU e não eles....\r\nFala muito e joga pouco, medo!!!!\r\nKkkkkk 20 min do precioso tempo é muito... brincadeira!!!', 'MuriloGarrido');
