INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8803, 1241, 952, '2017-05-25 00:00:00', '10:38', 'Bom Dia!\r\nPrimeiramente, eu respeito a decisão da moderação mas não entendo. Meu adversário me deu 2 dias pra jogar, eu so conseguia jogar em um dos dias q ele colocou devido ao meu trabalho. E ele não pode jogar no dia q eu falei q podia jogar(e ele tb falou) devido ao mesmo motivo.\r\nA minha resposta foi dentro do prazo e eu respondi q poderia jogar dentro do horário q meu adversario citou, porem ele teve um imprevisto de trabalho.\r\n\r\nEntão não entendo o pq o WO foi pra ele. Na terça q ele podia, eu não podia por causa do meu trabalho. E na 4a que eu podia o dia inteiro (Tanto q fiz minha final da copa da UEFA nesse dia), ele não pode por causa do trabalho dele. \r\nEntão qual seria a diferença?? Mesmo q no ultimo dia, todas as informações foram passadas a tempo, dentro do prazo.\r\n\r\nTenham um bom dia!\r\nPedro Souza', 'pdesouza7');
INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8804, 1249, 1146, '2017-05-25 00:00:00', '13:10', 'O filho se tem que ganhar pq se vc me eliminou pra não ser campeao pode esquecer kkkkkkkk', 'Rthomazelli');
INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8805, 1241, 985, '2017-05-25 00:00:00', '15:29', '#5   airesdias -  -  25/05/2017 05:22 \r\nPedro, infelizmente não podemos adiar por causa do calendário, então estarei decretando WO para o Real pois você entrou apenas no último dia para marcar dificultando a realização da partida. \r\n\r\npedro por isso foi decretado o wo \r\nvc so apareceu no site no topico no ultimo dia e isso e considerado omissao parcial entendeu', 'saydsangelll');
INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8806, 1241, 952, '2017-05-25 00:00:00', '16:29', 'Mano, não tô querendo criar nenhuma confusão, se ta parecendo, me desculpem. \r\nMas de novo eu não concordo. \r\nExiste um prazo, e mesmo q fosse no último dia, eu estava dentro desse prazo. E o q eu tô querendo explicar é o seguinte. Não respondi antes pq estava em missão, trabalho. Porém, mesmo q eu respondesse, eu não estaria apto para jogar antes de 4a devido ao meu trabalho, não respondi pq não quis, eu tava no meio do nada, não tinha como comunicar, foi algo devido a trabalho (mesmo motivo que o sayds não pode jogar na 4a). Assim q cheguei em casa, pela manhã, eu respondi o tópico dizendo q eu podia jogar na 4a, nos horários propostos pelo próprio sayds. Contudo, o sayds colocou q não estaria apto mais a jogar naquele horário proposto por ele mesmo, devido ao mesmo motivo que eu não pude jogar antes. \r\nOu seja, os motivos eram os mesmos. E sendo no último dia ou não, existe um prazo e o prazo foi seguido. Porém, o jogo não pode ser realizado devido aos dois oponentes sofrerem do MESMO problema. \r\n\r\nDe novo, não estou criando confusão, nunca tive problema nenhum aqui. Porém, descordo dessa decisão e como usuário do site, me sinto no direito de falar. Contudo, como sempre,  respeito a decisão da ADM, mesmo discordando da mesma.\r\n\r\nPedro Souza', 'pdesouza7');
INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8807, 1241, 952, '2017-05-25 00:00:00', '16:32', 'Discordo*', 'pdesouza7');
INSERT INTO `TB_COMENTARIO_JOGO_15` (`ID_COMENTARIO`, `ID_TABELA_JOGO`, `ID_USUARIO`, `DT_COMENTARIO`, `HR_COMENTARIO`, `DS_COMENTARIO`, `PSN_ID`) VALUES (8808, 1249, 790, '2017-05-26 00:00:00', '16:41', 'é hoje que vou mostrar o verdadeiro lugar do vitao, o segundo lugar kkkkkk\r\nrenan voce pipocou na semi pro vitor, nao tem moral de aparecer por aqui kkkkkkkkk', 'davidcp1402');
